import React, { useState } from 'react';
import Axios from 'axios';
import { Link } from 'react-router-dom';

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await Axios.post('http://127.0.0.1:3000/login', {
        email,
        password,
      });

      if (response.status === 200) {
        // تسجيل الدخول بنجاح، يمكنك توجيه المستخدم أو القيام بإجراءات أخرى
        alert('تم تسجيل الدخول بنجاح');
      }
    } catch (error) {
      // التعامل مع خطأ تسجيل الدخول، على سبيل المثال، عرض رسالة خطأ
      alert('خطأ تسجيل الدخول: يرجى التحقق من معلوماتك.');
    }
  };

  return (
    <div>
      <form onSubmit={handleLogin}>
      <div className="w-full max-w-sm mx-auto overflow-hidden bg-white rounded-lg shadow-md dark:bg-gray-800">
  <div className="px-6 py-4">
    <h3 className="mt-3 text-xl font-medium text-center text-gray-600 dark:text-gray-200">
      Welcome Back
    </h3>
    <p className="mt-1 text-center text-gray-500 dark:text-gray-400">
      Login or create account
    </p>
    <form>
      <div className="w-full mt-4">
        <input
          className="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-500 bg-white border rounded-lg dark:bg-gray-800 dark:border-gray-600 dark:placeholder-gray-400 focus:border-blue-400 dark:focus:border-blue-300 focus:ring-opacity-40 focus:outline-none focus:ring focus:ring-blue-300"
          type="email"
          placeholder="Email Address"
          aria-label="Email Address"
        />
      </div>
      <div className="w-full mt-4">
        <input
          className="block w-full px-4 py-2 mt-2 text-gray-700 placeholder-gray-500 bg-white border rounded-lg dark:bg-gray-800 dark:border-gray-600 dark:placeholder-gray-400 focus:border-blue-400 dark:focus:border-blue-300 focus:ring-opacity-40 focus:outline-none focus:ring focus:ring-blue-300"
          type="password"
          placeholder="Password"
          aria-label="Password"
        />
      </div>
      <div className="flex items-center justify-between mt-4">
        <a
          href="#"
          className="text-sm text-gray-600 dark:text-gray-200 hover:text-gray-500"
        >
          Forget Password?
        </a>
        <button className="px-6 py-2 text-sm font-medium tracking-wide text-white-100 capitalize transition-colors duration-300 transform bg-green-500 rounded-lg hover:bg-blue-400 focus:outline-none focus:ring focus:ring-blue-300 focus:ring-opacity-50">
          Sign In
        </button>
      </div>
    </form>
  </div>
  <div className="flex items-center justify-center py-4 text-center bg-gray-50 dark:bg-gray-700">
    <span className="text-sm text-gray-600 dark:text-gray-200">
      Don't have an account?{" "}
    </span>
    <Link
      to="/signup"
      className="mx-2 text-sm font-bold text-blue-500 dark:text-blue-400 hover:underline"
    >
      Register
    </Link>
  </div>
</div>

      </form>
    </div>
  );
}

export default Login;
